export default (props)=>{

    const userdata = loadGetInitialProps.userdata

   return (
    <Layout>
    <div className='container-home'>

        <h1 className='heroText'>{userdata}</h1>



    <style jsx global>{`

        html{
            scroll-behavior : smooth;
        }

        body{
            padding : 0px;
            margin : 0px;
            overflow-x : hidden;
            font-family: 'Raleway', sans-serif;
        }



    `}</style>


    </div>
</Layout>
   )
}
